import React from 'react';
import TableUsers from "../components/TableUsers";
import '../styles/App.css'

const Users = ({users}) => {
    return (
        <div className="App">
            <h1>Users:</h1>
            <TableUsers users={users}/>
        </div>
    );
};

export default Users;
